import "./TradeItem.css";
import "./TradeDate.js";

function TradeItem(props) {


  return (
    <div className="trade-item">

      <div className="trade-item__description">
        <h2>${props.name}</h2>
        <h2>${props.ticker}</h2>
        <div className="trade-item__pnl">${props.pnl}</div>
      </div>
    </div>
  );
}

export default TradeItem;
